import gmail from '../../images/gmailgreen48.png';
import d from '../../images/dpng.png';
import  './hero.css';



export default class Navbar extends Component {


	render() {
		return (
			<div className='hero'>
				<div className='content'>
					<span className='jump'>H</span>
					<span className='jump'>i</span>
					<span className='jump'>,</span>

					{/* Hi, */}
					<br/>
					<span className='jump'>I</span>
					<span className='jump'>'</span>
					<span className='jump'>m</span>

					<div className='danielle'>
				<span className='d-logo'>
					<span>D</span>
					<span>D</span>
				</span>
					<span>anielle Aharon</span></div>
					<br/>
					Web Developer
					</div>
				{/* <div className='d-logo'>
					<p>D</p>
					<p>D</p>
				</div> */}

			</div>


		);
	}
}
